CREATE TABLE `personas` (
  `persona_id` int unsigned NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) NOT NULL,
  `apellidos` varchar(100) NOT NULL,
  `email` varchar(255) NOT NULL,
  `telefono` varchar(15) DEFAULT NULL,
  `celular` varchar(15) DEFAULT NULL,
  `direccion_id` int unsigned NOT NULL,
  `fecha_inicial` date DEFAULT NULL,
  `fecha_final` date DEFAULT NULL,
  `entidad_id` int unsigned NOT NULL,
  `personadetalle_id` int unsigned DEFAULT NULL,
  `fnacimiento` date DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  PRIMARY KEY (`persona_id`,`direccion_id`,`entidad_id`),
  UNIQUE KEY `persona_id_UNIQUE` (`persona_id`),
  KEY `personadetalle_id` (`personadetalle_id`),
  KEY `entidad_id` (`entidad_id`),
  KEY `direccion_id` (`direccion_id`),
  CONSTRAINT `personas_ibfk_1` FOREIGN KEY (`personadetalle_id`) REFERENCES `personadetalles` (`personadetalle_id`),
  CONSTRAINT `personas_ibfk_2` FOREIGN KEY (`entidad_id`) REFERENCES `entidades` (`entidad_id`),
  CONSTRAINT `personas_ibfk_3` FOREIGN KEY (`direccion_id`) REFERENCES `direcciones` (`direccion_id`)
) ENGINE=InnoDB AUTO_INCREMENT=901 DEFAULT CHARSET=latin1;
