CREATE DEFINER=`root`@`localhost` FUNCTION `fx_calcular_ganancia`(p_producto_id INT) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
DECLARE ganancia DECIMAL(10,2);
	if not exists(
		select 1 from productos where producto_id = p_producto_id
    ) then
		SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El producto no existe.';
    END IF;
    SELECT (precioVenta - precioCosto) INTO ganancia
    FROM productos
    WHERE producto_id = p_producto_id;
    RETURN ganancia;
END ;;
