CREATE DEFINER=`root`@`localhost` FUNCTION `fx_total_ventas`(
    fecha_inicial DATE,
    fecha_final DATE
) RETURNS decimal(10,2)
    DETERMINISTIC
BEGIN
    DECLARE total_ventas DECIMAL(10,2);
    
    SELECT FORMAT(SUM(`total_fact`), 2, 'es_CR') INTO total_ventas
    FROM `facturas`
    WHERE `fecha_pago` BETWEEN fecha_inicial AND fecha_final;
    
    RETURN total_ventas;
END ;;
