CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_actualizar_producto`(
    IN p_producto_id INT,
    IN p_nombre VARCHAR(100),
    IN p_precioCosto DECIMAL(10,2),
    IN p_precioVenta DECIMAL(10,2),
    IN p_cantidad DECIMAL(10,2),
    IN p_fechaCompra DATE,
    IN p_proveedor_id INT,
    IN p_unidad_id INT,
    IN p_productodetalle_id INT
)
BEGIN
	DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN
		ROLLBACK;
	END;
  
	start transaction;
	IF NOT EXISTS (
		-- verifica que el producto a modificar exista
        SELECT 1
        FROM productos
        WHERE producto_id = p_producto_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El producto no existe.';
    END IF;
    IF NOT EXISTS (
		-- verifica que el proveedor digitado exista
        SELECT 1
        FROM proveedores
        WHERE proveedor_id = p_proveedor_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El proveedor no existe.';
    END IF;
    IF NOT EXISTS (
		-- verifica la unidad de medida
        SELECT 1
        FROM unidades
        WHERE unidad_id = p_unidad_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'La unidad de Medida no existe.';
    END IF;
    
    IF NOT EXISTS (
		-- verifica si existe el detalle de producto 
        SELECT 1
        FROM productodetalles
        WHERE productodetalle_id = p_productodetalle_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El detalle del producto no existe.';
    END IF;
		UPDATE productos
			SET nombre = p_nombre,
				precioCosto = p_precioCosto,
				precioVenta = p_precioVenta,
				cantidad = p_cantidad,
				fechaCompra = p_fechaCompra,
				proveedor_id = p_proveedor_id,
				unidadMedida_id = p_unidad_id,
				productodetalle_id = p_productodetalle_id
			WHERE producto_id = p_producto_id;
	COMMIT;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
