CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_agregar_producto`(
    IN p_nombre VARCHAR(100),
    IN p_precioCosto DECIMAL(10,2),
    IN p_precioVenta DECIMAL(10,2),
    IN p_cantidad DECIMAL(10,2),
    IN p_fechaCompra DATE,
    IN p_proveedor_id INT,
    IN p_unidadMedida_id INT,
    IN p_productodetalle TEXT
)
BEGIN
	DECLARE v_productodetalle_id INT;
	
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
	BEGIN
		ROLLBACK;
	END;
  
	start transaction;

    IF NOT EXISTS (
        SELECT 1
        FROM proveedores
        WHERE proveedor_id = p_proveedor_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'El proveedor no existe.';
    END IF;

    IF NOT EXISTS (
        SELECT 1
        FROM unidades
        WHERE unidad_id = p_unidadMedida_id
    ) THEN
        SIGNAL SQLSTATE '45000' SET MESSAGE_TEXT = 'La unidad de medida no existe.';
    END IF;

	IF NOT exists (
		SELECT 1 FROM productodetalles where productodetalle= p_productodetalle)
	then
		-- Si el detalle no existe lo agrega a la tabla productodetalles y toma el 
        -- ultimo id en la tabla como referencia 
		INSERT INTO productodetalles (productodetalle) VALUES (p_productodetalle);
		SET v_productodetalle_id = LAST_INSERT_ID();
	end if;
    SET v_productodetalle_id = (SELECT productodetalle_id from productodetalles where productodetalle= p_productodetalle);
    INSERT INTO productos (nombre, precioCosto, precioVenta, cantidad, fechaCompra, proveedor_id, unidadMedida_id, productodetalle_id)
    VALUES (p_nombre, p_precioCosto, p_precioVenta, p_cantidad, p_fechaCompra, p_proveedor_id, p_unidadMedida_id, v_productodetalle_id);
    COMMIT;
END ;;
