CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_listar_tablas`()
BEGIN
SELECT
t.TABLE_NAME AS 'Table',
c.COLUMN_NAME AS 'Field',
c.DATA_TYPE AS 'DataType',
CASE
WHEN c.COLUMN_KEY = 'PRI' THEN 'PK'
WHEN c.COLUMN_KEY = 'UNI' THEN 'UK'
WHEN c.COLUMN_KEY = 'MUL' THEN 'FK'
WHEN c.COLUMN_KEY = 'NULL' THEN ' '
ELSE ''
END AS 'KeyType',
ifnull(rc.REFERENCED_TABLE_NAME,' ') AS 'Entity'
FROM
INFORMATION_SCHEMA.TABLES t
JOIN INFORMATION_SCHEMA.COLUMNS c ON t.TABLE_NAME = c.TABLE_NAME
LEFT JOIN INFORMATION_SCHEMA.KEY_COLUMN_USAGE kc ON c.TABLE_NAME = kc.TABLE_NAME AND c.COLUMN_NAME = kc.COLUMN_NAME
LEFT JOIN INFORMATION_SCHEMA.REFERENTIAL_CONSTRAINTS rc ON kc.CONSTRAINT_NAME = rc.CONSTRAINT_NAME
WHERE
t.TABLE_SCHEMA = DATABASE()
ORDER BY
t.TABLE_NAME, c.ORDINAL_POSITION;
END ;;
